		"lat": 4.3304526,
		"country": "BE",
		"desc": "Cornelis de Vos, een jongere tijdgenoot en vriend van Rubens, was in verschillende genres werkzaam. Zijn talent komt echter vooral tot uiting in de portretten van burgers die hij tussen 1620 en 1640 schilderde. Uit dit familieportret blijkt dat hij een meester is in de compositie van groepsportretten en de uitbeelding van kinderen. Hij is een van de eerste kunstenaars die kinderen, ondanks hun pose en zware feestkledij, niet portretteert als kleine volwassenen maar met de spontaneteit en openheid eigen aan hun leeftijd. Het Familieportret is klaar en overzichtelijk opgebouwd, met een groot vakmanschap in de stofweergave en een opvallende natuurlijkheid in de blik en gebaren. De Vos maakt geen karakterstudies, maar blijft een nuchtere en objectieve toeschouwer. Het familieportret heeft ook een moraliserende betekenis. De rode appel refereert aan de vruchtbaarheid en de op de voortplanting gerichte huwelijksethiek van de zeventiende-eeuwse burgerij."
