		"lat": 2.5858564,
		"country": "BE",
		"desc": "Omstreeks 1830 was Jean Baptiste Camille Corot een van de vroegste bezoekers van Barbizon, het dorpje aan de rand van het woud van Fontainebleau, waar de zogenaamde School van Barbizon zou ontstaan. Nog volledig volgens de classicistische traditie zijn vele van zijn studies en plein air bedoeld als voorbereiding voor grote historiestukken. Steengroeve van Chaise-Marie in Fontainebleau daarentegen is een zelfstandig uitgevoerd landschapsportret, direct naar de natuur geschilderd. Voorgesteld is een verlaten steengroeve die nog enkel werd bezocht door de plaatselijke bevolking om er hout te sprokkelen. Het landschap is niet mooi te noemen, maar een plek waar de mens ooit de natuur heeft gexploiteerd. Coloristisch is het schilderij interessant. Aan de overheersende bruine, beige en groene tinten voegde Corot immers wat grijs toe om aan het geheel een tonale eenheid te geven."
