		"lon": 50.414695,
		"lat": 1.5459361,
		"country": "FR",
		"desc": "Eugne Boudin is geboren in 1824, het jaar dat op het Salon van Parijs de tentoonstelling wordt gehouden die van grote betekenis zal zijn voor de bewustwording van de School van Barbizon. Op dit Salon worden Franse romantische kunstenaars als Delacroix en Gricault en Engelse landschapsschilders als Bonington en Constable gexposeerd. Deze bevestigen de Barbizon-schilders in hun nieuwe visie op de landschapsschilderkunst en confirmeren de breuk tussen de klassieken en de modernen. Boudin begint dus zijn carrire als schilder in een tijd dat de moderne landschapsschilders reeds hun stempel op de Franse schilderkunst hebben gedrukt. Hun invloed is groot en ook Boudin ondergaat de inspirerende werking van deze kunstenaars. Als zoon van een schipper gaat zijn voorkeur uit naar het schilderen van zeegezichten, waarin grote aandacht wordt besteed aan het grote luchtoppervlak met wolken boven het water en het licht dat het hele landschap overdekt. Onder toedoen van Isabey maakt Boudin vanaf de jaren 1860 een hele reeks strandscnes, hoofdzakelijk bevolkt door bourgeoisie-mensen die hun vrije tijd doorbrengen aan de kust. Maar ook minder gegoede personen als vissers en vissersvrouwen verdienen zijn aandacht, zoals blijkt in Wasvrouwen te Etretat. Dit werk is vervaardigd in het laatste decennium van zijn leven. Typisch voor vele van dergelijke schilderijen is de verdeling van de compositie in drie horizontale, parallelle zones die worden ingenomen door de lucht, de zee en het strand. Het gevoel voor de atmosferische werking van het natuurlijke licht kondigt het impressionisme aan. Het koele, zilverige licht en de matte, vale tinten worden hier en daar verlevendigd door het wit van de kapjes en het rood in de kleren op de voorgrond. De simplificatie van de vorm en de vrije, suggestieve factuur verlenen aan dit werkje, ondanks het anekdotische element, een bredere en meer bestendige expressiewaarde."
